import React, { useState } from 'react';

const CountryFlagIcon = ({ country }) => {

    const [countryCode, setCountryCode] = useState('az');

    var images = <></>;

    if ( country.toLowerCase().includes('usa') )
        images += <img src={`https://flags.fmcdn.net/data/flags/mini/${countryCode}.png`} />
    
    if ( country.toLowerCase() == 'uk' )
        images += <img src={`https://flags.fmcdn.net/data/flags/mini/${countryCode}.png`} />


    return <img src={`https://flags.fmcdn.net/data/flags/mini/${countryCode}.png`} />;
};

export default CountryFlagIcon;
